import websiteLogo from '../resources/CookieDoughLogo.svg';
import cartIcon from '../resources/cart.svg';
import profileIcon from '../resources/profile.svg';
import searchIcon from '../resources/search.svg';
import InputField from '../InputField/InputField';
import IconButton from '../IconButton/IconButton'
import './Header.css';

function Header(){
    return(
    <div className= 'header-bar'>
        <div className= 'div-right'>
            <img src= {websiteLogo} className= 'website-logo'></img>
        </div>
        <div className= 'div-center'>
            <form className= 'search-form'>
                <InputField disc= 'Search'></InputField>
                <div className= 'search-button-div'>
                    <IconButton type= 'submit'>
                        <img src= {searchIcon} className= 'search-icon'></img>
                    </IconButton>
                </div>
            </form>
        </div>
        <div className= 'div-left'>
            <img src= {cartIcon} className= 'header-icon'></img>
            <img src= {profileIcon} className= 'header-icon'></img>
        </div>
    </div>)
}

export default Header;
